tyson-draws-stuff-the-covid-years.description:
We have our second art book is here.&nbsp;

Covid sucked. It separated us and made us lonely.&nbsp;

To combat this new world SadieTellsStories and I decided to make art. A lot of art. An uncomfortable amount of art, and share that art and make a community.&nbsp;

We did that.

And this book is the byproduct.

The book is 230 pages, 9x12 mostly full colour (except for all the black and white ink pages)

&nbsp;

It's amazing

